import React from 'react';
import Card from './card.js';
import CardV2 from './card-v2.js';
import CardAdd from './cardadd.js';
import "./cardbook.scss";

const CardBook = (props) => {
    return (
        <div className="cardbook">
            <CardV2 />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <CardAdd />
        </div>
    );
}

export default CardBook;
